import React from 'react'
import { Swiper, SwiperSlide } from 'swiper/react';

import 'swiper/css';
import "swiper/css/effect-cards";

import 'swiper/css/pagination';
import 'swiper/css/navigation';

import { EffectCards, Pagination, Navigation } from 'swiper';

const Cards = () => {

    return (
        <div>
            <Swiper
                effect={"cards"}
                grabCursor={true}
                centeredSlides={true} z
                loop={true}
                slidesPerView={'auto'}
                pagination={{ el: '.swiper-pagination', clickable: true }}
                navigation={{
                    nextEl: '.swiper-button-next',
                    prevEl: '.swiper-button-prev',
                    clickable: true,
                }}
                modules={[EffectCards, Pagination, Navigation]}
                className="swiper_container"
            >
                <SwiperSlide className='bg-white text'>Slide 1</SwiperSlide>
                <SwiperSlide className='bg-white text'>Slide 2</SwiperSlide>
                <SwiperSlide className='bg-white text'>Slide 3</SwiperSlide>


                {/* <div className="slider-controler">
                    <div className="swiper-button-prev slider-arrow">
                        <ion-icon name="arrow-back-outline"></ion-icon>
                    </div>
                    <div className="swiper-button-next slider-arrow">
                        <ion-icon name="arrow-forward-outline"></ion-icon>
                    </div>
                    <div className="swiper-pagination"></div>
                </div> */}
            </Swiper>
        </div>
    )
}

export default Cards
